import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux'; // Importez le Provider
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import { store } from './redux/store'; // Importez votre store Redux

ReactDOM.render(
  <React.StrictMode>
    <Provider store={store}> {/* Enveloppez votre App avec Provider et fournissez le store */}
      <App />
    </Provider>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
